import axios from "axios";

export async function login(userName, password) {
  const url = "http://localhost:8080";
  const params = {
    user: "Cona",
    pass: "cona"
  };

  console.log("Sending request");
  const response = await axios.get(url, params);
  console.log(response.data);
  return;
}
